import './App.css';
import {Route as Ruta} from 'react-router';
import initial from './components/initial';
import { Routes } from 'react-router';
//Aca empezamos a codificar y pasar los componentes.
function App() {
  return (
    <div className="App">
      <h1>Henry Food</h1> 
      <Routes>
      <Ruta path='/' component={<initial/>}/>
      </Routes>
    </div>
  );
}

export default App;
